function readFile() {
  if (this.files && this.files[0]) {
    var FR= new FileReader();
    FR.addEventListener("load", function(e) {
      document.getElementById("icon").src       = e.target.result;
      icon = e.target.result;
    }); 
    FR.readAsDataURL( this.files[0] );
  }
}

document.getElementById("inp").addEventListener("change", readFile);

var icon = "data:image/png;base64,";

function exportFile(){
  var zip = new JSZip();
  zip.file("manifest.json", JSON.stringify(manifest));
  zip.file("pack_icon.png", icon.replaceAll("data:image/png;base64,", ""), {base64: true});
  for(var i = 0; i < document.getElementsByClassName("idchecker").length; i++){
    if(document.getElementsByClassName("idchecker")[i].checked){
      console.log(zip.folder(document.getElementsByClassName("idchecker")[i].value));
    }
  }
  
  if(!document.getElementById("include").checked){
    var lang = zip.folder("texts");
    lang.file("en_US.lang", "pack.name="+document.getElementById("title").value+"\npack.description="+document.getElementById("desc").value);
  }
  
  zip.generateAsync({type:"blob"})
  .then(function(content) {
    saveAs(content, document.getElementById("title").value.toLowerCase().replaceAll(" ", "_")+"."+document.querySelector('input[name="ziptype"]:checked').value);
  });
}